/**
 * Calculates the maximum number of consecutive elements with the same two values in the input array
 * @param {number[]} fruits
 * @return {number}
 */

var totalFruit = function(fruits) {
    function dp(fruits, i, picked, n){
        if(i == fruits.length) return n;
        if(!picked.has(fruits[i])){
            if(picked.size == 2){
                return n;
            }
            return Math.max(dp(fruits, i + 1, picked.add(fruits[i]), n + 1), dp(fruits, i + 1, new Set([fruits[i]]), 1))
        }
        return dp(fruits, i + 1, picked, n + 1);
        
    }
    return dp(fruits, 0, new Set(), 0);
};

var totalFruit = function(fruits) {
    let picked = new Set(), pickedLast = new Set();
    let curr = 0, currLast = 0, max = 0;
    for(const e of fruits){
        if(picked.has(e)){
            curr++;
            if(pickedLast.has(e)){
                currLast++;
            }else{
                pickedLast = new Set([e]);
                currLast = 1;
            }
        }else{
            if(picked.size == 2){
                if (curr > max){
                    max = curr;
                }
                picked = new Set(...pickedLast.entries());
                curr = currLast;
            }
            pickedLast = new Set([e]);
            currLast = 1;
            picked.add(e);
            curr++;
        }
    }
    return Math.max(curr, max);
};

